import React from "react";

const Tabledata = () => {
  return (
    <tr>
      <th>
        <label class="customcheckbox m-b-20">
          <input type="checkbox" id="mainCheckbox" />
          <span class="checkmark"></span>
        </label>
      </th>
      <td>12/11/2022</td>
      <td>Bill</td>
      <td>Clinton</td>
      <td>ICT</td>
    </tr>
  );
};

export default Tabledata;
